import React from 'react';

function ProjectCountPage(props: {count: number}) {
    const handleClick = () => {
        count += 1;
        ProjectCountPage(count);
    }
    return(
        <div>
            <div>
                You have {count} Projects
            </div>;
            <button onClick={handleClick}>
                Click me
            </button>
        </div>
    );
}

export default ProjectCountPage;
